# Configuraes iniciais

# import das bibliotecas
import pandas as pd
import numpy as np
import random
from scipy.stats import poisson

# 'selecoes' e 'jogos' so do tipo Series
selecoes = pd.read_excel('sample_data/DadosCopaDoMundoQatar2022.xlsx', sheet_name ='selecoes', index_col = 0) # 'index_col = 0' indica o nmero da coluna
                                                                                                  # que deve ser utilizada com ndice ao carregar
                                                                                                  # o arquivo. nesse caso, ndice 0 = 'selecoes'
jogos = pd.read_excel('sample_data/DadosCopaDoMundoQatar2022.xlsx', sheet_name ='jogos')

# As duas estruturas de dados principais que a biblioteca pandas utiliza so: DataFrame e Series. O DataFrame  uma estrutura
# bidimensional com linhas e colunas nomeadas, similar a uma tabela SQL. J a estrutura Series  um array
# nomeado e unidimensional. As chaves (nomes) dos valores no Series so referenciados como index, e ambas as estruturas so capazes
# de armazenar qualquer tipo de dados (inteiro, string, float, objetos, etc.)

# Ajuste de fora dos 'PontosRankingFIDA' de cada seleo atravs de uma transformao linear de escala numrica
fifa = selecoes['PontosRankingFIFA'] # A varivel 'fifa'  atribuido os valores da coluna 'PontosRankingFIFA'

a, b = min(fifa), max(fifa)
fa, fb = 0.15, 1
b1 = (fb - fa)/(b-a) # Coeficiente angular do ajuste
b0 = fb - b*b1       # Coeficiente linear do ajuste
forca = b0 + b1*fifa # Funo de fora ajustada. 'forca' tambm  do tipo 'Series'

forca.sort_values(ascending = False) # Ordena dados da seleo mais forte para a menos forte

# Funes para clculo do resultado de uma nica partida entre duas selees (selecao1, selecao2)

# Funo que define a mdia da ocorrncia de gols das selees
def MediasPoisson(selecao1, selecao2):
    forca1 = forca[selecao1]            # 'selecao1' e 'selecao2' so as chaves da Series 'forca', que  um Array, como j mencionado. os valores das foras so os valores
    forca2 = forca[selecao2]            # das chaves 'selecao1' ou 'selecao2'

    mgols = 2.75                        # Taxa de ocorrncia, esperana, frequncia mdia ou esperada... das copas
    l1 = mgols*forca1/(forca1 + forca2) # Mdia de gols da 'selecao1'
    l2 = mgols*forca2/(forca1 + forca2) # Mdia de gols da 'selecao2' | poderia ser: l2 = mgols - l1, pois l1+l2 = mgols
    return [l1, l2]                     # J retorna em formato de lista

# Chamada dentro da funo Pontos(), onde os parmetros gols1 e gols2 so gerados dentro da funo Pontos()
def Resultado(gols1, gols2):
    if gols1 > gols2:
        res = 'V'
    if gols1 < gols2:
        res = 'D'
    if gols1 == gols2:
        res = 'E'
    return res

# Funo que atravs do nmero de gols, define se a selecao1 vendeu, perdeu ou empatou com a selecao2
def Pontos(gols1, gols2):
    rst = Resultado(gols1, gols2)  # Atribui a 'rst' o resultado da partida atravs da funo Resultado()

    if rst == 'V':                 # Condicionais para armazenar a pontuao feita em cada partida. A comparao do resultado  feita em referncia a seleo1.
        pontos1, pontos2 = 3, 0    # Por exemplo, se 'rst' ='V', significa que a fez mais gols e venceu a partida. Logo, pontos1 = 3 (selecao1), pontos2 = 0 (selecao2)
    if rst == 'E':
        pontos1, pontos2 = 1, 1
    if rst == 'D':
        pontos1, pontos2 = 0, 3
    return pontos1, pontos2, rst

# Funo para simulaes de jogos (funo mestra)
def Jogo(selecao1, selecao2):
    l1, l2 = MediasPoisson(selecao1, selecao2)             # Atribui a l1 e l2 as mdias de gols calculadas na funo MediasPoisson
    gols1 = int(np.random.poisson(lam = l1, size = 1))     # Parmetro 'lam'  o nmero esperado de eventos (gols) da 'selecao1' ou 'selecao2' ocorrendo
    gols2 = int(np.random.poisson(lam = l2, size = 1))     # em um intervalo de tempo fixo. Deve ser >= 0. Por exemplo, para l1 = 1.9 como valor esperado,
                                                           # uma nica amostra de nmero (size = 1) ser gerada em uma distriuio do tipo Poisson.
                                                           # A amostra numrica  arredondada pelo int()

    saldo1 = gols1 - gols2                                 # Saldo de gols da seleco1 na partida
    saldo2 = -saldo1                                       # saldo de gols da seleco2 na partida
    pontos1, pontos2, result = Pontos(gols1, gols2)        # Chamada da funo Pontos() para guardar a pontuao das selees na partida
    placar = '{}x{}'.format(gols1, gols2)
    # Retorna numa lista todos os dados de uma partida
    return [gols1, gols2, saldo1, saldo2, pontos1, pontos2, result, placar] # Retorna numa lista todos os dados de uma partida

# Exemplo da funo Jogo()

Jogo('Brasil','Argentina')

# Funes para calcular a tabela de distribuio de probabilidades para possveis placares entre duas selees

def Distribuicao(media):
    probs = []
    for i in range(7):                     # Range de 7, para considerar placar de at 7 gols
        probs.append(poisson.pmf(i,media)) # Funo poisson.pmf() calcula os valores de uma distribuio poisson para uma dada mdia e um dado valor 'i'.
                                           # O for() vai adicionar na lista 'probs' os valores da distribuio poisson gerados por 'poisson.pmf()'
    probs.append(1-sum(probs))             # Adiciona por ltimo o valor da probabilidade da ocorrncia de 7+ gols, que  1 - soma de todas as
                                           # probabilidades da lista 'probs'
    return pd.Series(probs, index = ['0', '1', '2', '3', '4', '5', '6', '7+']) # Transforma a lista 'probs' para o tipo 'Series' e atribui ndices, que indicam os gols

def ProbabilidadesPartida(selecao1, selecao2):
    l1, l2 = MediasPoisson(selecao1, selecao2)          # Atribui valores a l1 e l2 chamando a funo MediasPoisson()
    d1, d2 = Distribuicao(l1), Distribuicao(l2)         # Atribui a d1 e d2 a distribuio poisson, para mdias l1 e l2, atravs da funo 'Distribuio()'

    matriz = np.outer(d1, d2)                           # Monta a matriz de probabilidades. Funo outer() faz um produto vetorial entre d1 e d2
                                                        #  Usar pd.DataFrame(np.outer(d1, d2)) para uma melhor visualizao da matriz

    vitoria = np.tril(matriz).sum()-np.trace(matriz)    # Soma a triangulo inferior 'np.tril()'. 'np.trace()' calcula a soma dos elementos diagonais da matriz (empate)
    derrota = np.triu(matriz).sum()-np.trace(matriz)    # Soma a triangulo superior 'np.triu()'. Distribuio de gols da selecao1  referenciada por 'd1', por isso 'np.tril()'
    empate = 1 - (vitoria + derrota)                    # ou empate = np.trace(matriz)

    probs = np.around([vitoria, empate, derrota], 3)    # 'np.Around()' arredonda os valores da lista 'probs', com 3 casas decimais
    probsp = [f'{100*i:.1f}%' for i in probs]           # Multiplica cada valor da lista 'probs' por 100, para ter o valor das probabilidades %

    nomes = ['0', '1', '2', '3', '4', '5', '6', '7+']                           # Ser utilizada como ndices
    matriz = pd.DataFrame(matriz, columns = nomes, index = nomes)               # Transforma a matriz em um dataframe
    matriz.index = pd.MultiIndex.from_product([[selecao1], matriz.index])       # Torna a seleo 1 como ndice. 'pd.MultiIndex().from_product()' cria dois ndices
    matriz.columns = pd.MultiIndex.from_product([[selecao2], matriz.columns])   # Torna a seleo 2 como coluna

    output = {'Seleo 1': selecao1, 'Seleo2': selecao2,
             'fora 1': forca[selecao1], 'fora 2': forca[selecao2],
             'Mdia gols 1': l1, 'Mdia gols 2': l2,
             'Probabilidades': probsp, 'Probabilidade de placares': matriz}
    return output

# Exemplo da funo ProbabilidadesPartida()

ProbabilidadesPartida('Brasil','Argentina')

